import React from 'react';
import classes from './Music.module.css';


function Dialogs(props) {
    return (
        <div className={classes.dialog-items}>
            <div className="dialogs">
            <div className="dialog">Dima</div>
            <div className="dialog">Ann</div>
            <div className="dialog">Art</div>
            <div className="dialog">Eva</div>
            <div className="dialog">Karen</div>
            </div>




            <div className="messages">
                <div className="message">Hi!!!</div>
                <div className="message">How is your it-kamasutra?????</div>
                <div className="message">Yoo</div>
            </div>

        </div>
    )
}


export default Dialogs;
